import React, { useState } from "react";
import { Form, Button } from "react-bootstrap";
import { connect } from "react-redux";
import { useEffect } from "react";
import { RegisterUserInfo } from "../redux/actions/Register_actions";
import { useNavigate } from "react-router-dom";

const Register = (props) => {
  const [name, setName] = useState("");
  const [phone, setPhone] = useState("");
  const navigate = useNavigate();
  const [ecorr, eCorr] = useState("");
  const [pcorr, pCorr] = useState("");

  const submit = (e) => {
    if (ecorr === "" || pcorr === "") {
      console.log("1");
    } else {
      console.log("0");
    }
    e.preventDefault();
    //console.log(ecorr);
    // e.preventDefault();
    // let data = {
    //   employeeName: employeeName,
    //   phone: phone,
    // };
    // console.log(data);
    // props.RegisterUserInfo(data);
    // navigate("/");
  };

  // useEffect(() => {
  //   console.log("registration", props.details);
  // }, [props]);
  function phon() {
    /^[(]{0,1}[0-9]{3}[)]{0,1}[-\s\.]{0,1}[0-9]{3}[-\s\.]{0,1}[0-9]{4}$/.test(
      phone
    )
      ? pCorr("")
      : pCorr("Please Correct your Phone Number");
  }
  function empname() {
    /^[a-zA-Z]*$/.test(name) && name.length != " "
      ? eCorr("")
      : eCorr("Please Correct your Name");
  }
  return (
    <div className="reg-div">
      <Form className="reg-form">
        <Form.Group className="mb-3 reg-inbox">
          <Form.Control
            type="text"
            placeholder="Your Name"
            onChange={(e) => setName(e.target.value)}
            onBlur={empname}
            onClick={(e) => eCorr("")}
          />
          <div>{ecorr}</div>
        </Form.Group>

        <Form.Group className="mb-3 reg-inbox" controlId="formBasicEmail">
          <Form.Control
            type="text"
            placeholder="Enter Phone"
            onChange={(e) => setPhone(e.target.value)}
            onBlur={phon}
            onClick={(e) => pCorr("")}
          />
          <div>{pcorr}</div>
        </Form.Group>

        <Button
          className="reg-btn"
          variant="primary"
          type="submit"
          onClick={submit}
        >
          Submit
        </Button>
      </Form>
    </div>
  );
};

const mapStateToProps = (state) => ({
  details: state.registraton,
});

const mapDispatchToProps = {
  // getUserInfo,
  RegisterUserInfo,
};

export default connect(mapStateToProps, mapDispatchToProps)(Register);
